componentsModule.modules.revisions={start:function(){let current=componentsModule.modules.revisions;current.parentElement=document.querySelector("[data-component=revisions]");current.textInput=current.parentElement.querySelector("textarea");current.listElement=current.parentElement.querySelector(".revisions-list");current.templateElement=current.parentElement.querySelector("#template_component_revisions_item").childNodes[0]},resume:function(){let current=componentsModule.modules.revisions;const b=current.parentElement.getAttribute("data-resume");if(b===""){return true}const a=JSON.parse(b).revision;if(a===null){return true}a.forEach(function(c){let template=current.templateElement.cloneNode(true);template.childNodes[0].innerText=c.created_at;template.childNodes[1].innerText=c.description;current.listElement.appendChild(template)});current.listElement.scrollTop=current.listElement.scrollHeight;reloadPackery()},validate:function(){const a=componentsModule.modules.revisions.serialize().revision;return(a.length<251)},serialize:function(){return{revision:componentsModule.modules.revisions.textInput.value.trim()}}};